import { createRouter, createWebHistory } from 'vue-router';
import MainApp from './components/MainApp.vue';
import SobreNosotros from './components/Nosotros.vue';
import PageContacto from './components/Contacto.vue';
import LoginForm from './components/LoginForm.vue';
import AppTareas from './components/AppTareas.vue';

const routes = [
    {
      path: '/',
      name: 'MainApp',
      component: MainApp
    },
    {
      path: '/Nosotros',
      name: 'SobreNosotros',
      component: SobreNosotros
    },
    {
      path: '/Tareas',
      name: 'Tareas',
      component: AppTareas
    },
    {
      path: '/Contacto',
      name: 'Contacto',
      component: PageContacto
    },
    {
      path: '/LoginForm',
      name: 'LoginForm',
      component: LoginForm
    },
  ];
  
  const router = createRouter({
    history: createWebHistory(),
    routes
  });

export default router;
